134.source:
function draw(w, h) {
    var re = this.re;

    function title(d) {
        return d.parentNode ? (title(d.parentNode) + "." + d.nodeName) : d.nodeName;
    }

    var color = pv.Colors.category19().by(function(d){return d.parentNode.nodeName});
    var nodes = pv.dom(this.data).root("root").nodes();

    var vis = new pv.Panel()
        .width(w)
        .height(h)
        .fillStyle("gray")
        .event("mousedown", pv.Behavior.pan())
        .event("mousewheel", pv.Behavior.zoom());

    var treemap = vis.add(pv.Layout.Treemap).nodes(nodes)
        .round(true);

    treemap.leaf.add(pv.Panel)
        .fillStyle(function(d){ return  color(d).alpha(title(d).match(re) ? 1 : .2) })
        .strokeStyle("#fff")
        .lineWidth(1)
        .antialias(false);

    treemap.label.add(pv.Label)
        .textStyle(function(d) {return pv.rgb(0, 0, 0, 1)});

    return vis;
}

